<p>相比于Nginx，它具有如下优点：</p>
<ol>
<li><strong>自动服务发现</strong>：传统的边缘路由器（或反向代理）需要一个配置文件，其中包含到您的服务的所有可能的路由，而 Traefik 从服务本身获取它们。</li>
<li><strong>原生兼容所有主要集群技术</strong>，例如 Kubernetes、Docker、Docker Swarm、AWS、Mesos、Marathon，并且可以同时处理多个。</li>
<li>无需维护和同步单独的配置文件，<strong>自动实时更新</strong>，无需重新启动，不会中断连接</li>
<li>集成了漂亮的 <code>dashboard</code> 界面</li>
